    @Override
    public Action getAction() {
        return (final ActionContext actionContext) -> {
            try {
                final BetfairClient<BetfairClientParameters> client = actionContext.getClient();
                if (client != null) {
                    final JobDataMap jobDataMap = actionContext.getContext().getJobDetail().getJobDataMap();
                    final Set<String> eventTypeIds = new HashSet<>(0);
                    final Set<String> eventIds = new HashSet<>(0);
                    final Set<String> marketIds = new HashSet<>(0);
                    final Set<RunnerId> runnerIds = new HashSet<>(0);
                    final Set<String> betIds = new HashSet<>(0);
                    final Side side = null;
                    final TimeRange settledDateRange = createTimeRange(jobDataMap);
                    final GroupBy groupBy = null;
                    final boolean includeItemDescription = true;
                    listSettledOrders(client, BetStatus.SETTLED, eventTypeIds, eventIds, marketIds, runnerIds, betIds, side, settledDateRange, groupBy, includeItemDescription, actionContext);
                    listSettledOrders(client, BetStatus.CANCELLED, eventTypeIds, eventIds, marketIds, runnerIds, betIds, side, settledDateRange, groupBy, includeItemDescription, actionContext);
                    listSettledOrders(client, BetStatus.LAPSED, eventTypeIds, eventIds, marketIds, runnerIds, betIds, side, settledDateRange, groupBy, includeItemDescription, actionContext);
                    listSettledOrders(client, BetStatus.VOIDED, eventTypeIds, eventIds, marketIds, runnerIds, betIds, side, settledDateRange, groupBy, includeItemDescription, actionContext);
                } else {
                    LOG.log(Level.WARNING, MSG_BETFAIR_CLIENT_IS_NULL);
                }
            }
            catch (Throwable ex) {
                LOG.log(Level.SEVERE, null, ex);
            }
        };
    }

    private void listSettledOrders(final BetfairClient<BetfairClientParameters> client, final BetStatus betStatus, final Set<String> eventTypeIds, final Set<String> eventIds,
            final Set<String> marketIds, final Set<RunnerId> runnerIds, final Set<String> betIds, final Side side, final TimeRange settledDateRange, final GroupBy groupBy,
            final boolean includeItemDescription, final ActionContext actionContext) throws Throwable {
        int fromRecord = 0;
        final int recordCount = 999999999;
        boolean hasMore = true;
        while (hasMore) {
            final ClearedOrderSummaryReport clearedOrderSummaryReport = client.listClearedOrders(betStatus, eventTypeIds, eventIds, marketIds, runnerIds, betIds, side, settledDateRange,
                    groupBy, includeItemDescription, fromRecord, recordCount);
            hasMore = clearedOrderSummaryReport.getMoreAvailable();
            fromRecord = clearedOrderSummaryReport.getClearedOrders().size();
            Dispatcher.getInstance(actionContext.getServletContext(), actionContext.getScheduler()).dispatch(clearedOrderSummaryReport, ClearedOrderSummaryReport.class);
        }
    }

    private TimeRange createTimeRange(final JobDataMap jobDataMap) {
        Date fromDate = new Date();
        fromDate.setTime(fromDate.getTime() - jobDataMap.getLongFromString(KEY_BETFAIR_LIST_CLEARED_ORDERS_TIME_RANGE_IN_HOURS) * MILLISECONDS_PER_HOUR);
        Date toDate = new Date();
        TimeRange itemDateRange = new TimeRange(fromDate, toDate);
        return itemDateRange;
    }
